			$("#mobile-app").attr('id','web-banner-growth');
			/* 
			Function name: loadChart 
			Description: ส่ง ajax บันทึกข้อมูใหม่ลจากฟอร์มและแสดงผลลัพธ์
			*/
			function loadChart(){
				/* ตรวจสอบค่าว่างของฟิลด์ */
				if($('#datepicker').val() == ""){
					alert('กรุณากรอกวันเกิด');
				}
				else if($('#servicedatepicker').val() == ""){
					alert('กรุณากรอกวันที่ชั่งน้ำหนัก วัดส่วนสูง รอบศีรษะ');
				}
				else if($('#weight').val() == "" && $('#height').val() == "" && $('#hcir').val() == ""){
					alert('กรุณากรอกข้อมูลอย่างน้อย 1 ข้อมูล');
				}
				else{
					$.ajax({
						type: 'POST',
						cache: false,
						url: 'appdek/growth_validate_no_login.php',
						dataType : 'text',
						data: { 
							servicedatepicker: $("#servicedatepicker").val(), 
							datepicker: $("#datepicker").val(),
							sex: $("#sex").val(),
							weight: $("#weight").val(),
							height: $("#height").val(),
							hcir: $("#hcir").val()
						},

						/* ประมวลผลโค้ดก่อนส่ง request */
						beforeSend:function(){ 
							$('#reference').attr('style','display: none;');
							$('#chart').html('<div class="loading"><img src="/appdek/img/loading.gif" alt="Loading..." height="100" width="100" style="margin-left: 250px; margin-top: 20px;"></div>');
						},

						/* ประมวลผลโค้ดเมื่อ response สำเร็จ */
						success:function(data){
							$('#chart').empty().html(data); // แสดงผลลัพธ์ HTML จากตัวแปร data
							$('#reference').attr('style','display: block;');
						},

						/* ประมวลผลโค้ดเมื่อเกิด error */
						error:function(){
							$('#chart').html('<p class="error"><strong>ขออภัย!</strong> .</p>');
						}
					});
				}
			}
			var d = new Date(); 
			var toDay = ("0"+d.getDate()).slice(-2) + '-'+ ("0"+(d.getMonth()+1)).slice(-2) + '-'+ (d.getFullYear()+543);
			$('#date').val(toDay); // กำหนดค่าวันปัจจุบันให้กับฟิลด์ "วันที่ปัจจุบัน"
			
			/* กำหนด action click ให้กับปุ่ม "ยืนยัน" */
			$("#submit").click(function(){
				loadChart();
			});
			
			/* กำหนด action click ให้กับปุ่ม "ล้างค่า" */
			$("#reset").click(function(){;
				location.reload(true); // โหลดหน้าใหม่
			});
			
		});
	</script>




